import { useLocation } from 'react-router-dom';

function InputForm() {
    const location = useLocation();
    const { selectedDate, selectedTime, fname, lname, image, department} = location.state || {};
  
    return (
      <div>
        <p>{fname} {lname}</p><br/>
        <p>{image}</p><br/>
        <br/>
        {selectedDate}<br/>
        <p>{selectedTime}</p>
      </div>
    );
}

export default InputForm;
